create table Healthcare US (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	patient_id INT,
	patient_name VARCHAR(50),
	dob DATE,
	diagnosis_code VARCHAR(50),
	procedure_code VARCHAR(50),
	admission_date DATE,
	discharge_date DATE,
	insurance_provider VARCHAR(22),
	billing_amount DECIMAL(7,2)
);
